import platform from "./platform";
import time from "./time";
import calculation from "./calculation";
import ui from "./ui";
import {
  t,
  LocalizationContext,
  withLocalization,
  LocalizationContextProps,
  supportedLanguages,
  currentLanguage,
  getLocaleForMoment,
} from "./translations";

export {
  calculation,
  platform,
  time,
  ui,
  t,
  LocalizationContext,
  withLocalization,
  LocalizationContextProps,
  supportedLanguages,
  currentLanguage,
  getLocaleForMoment,
};
